import React from "react";

class Contents extends React.Component {
    render() {
        return (
            <div class="container">
  <div class="row">
    <div class="col bg-primary h-100" id="column-1">
      First in DOM, no order applied
    </div>
    <div class="col order-5 bg-success" id="column-2">
      Second in DOM, with a larger order
    </div>
    <div class="col order-1 bg-warning" id="column-3">
      Third in DOM, with an order of 1
    </div>
  </div>
</div>
        );
    }
}

export default Contents;
